/*Table structure for table `register` */

DROP TABLE IF EXISTS `register`;

CREATE TABLE `register` (
  `id` int(11) NOT NULL auto_increment,
  `name` text,
  `email` text,
  `mobile` text,
  `address` text,
  `username` text,
  `password` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

/*Data for the table `register` */

insert  into `register`(`id`,`name`,`email`,`mobile`,`address`,`username`,`password`) values (2,'kishan','kishan@gmail.com','1234567890','hyd','kishan','123');

/*Table structure for table `words` */

DROP TABLE IF EXISTS `words`;

CREATE TABLE `words` (
  `id` int(11) NOT NULL auto_increment,
  `category` varchar(1000) default NULL,
  `word` varchar(1000) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=latin1;

/*Data for the table `words` */

insert  into `words`(`id`,`category`,`word`) values (1,'hate speech ','hateful'),(2,'hate speech ','despise'),(3,'hate speech ','spite'),(4,'hate speech ','enmity'),(5,'provokers','agitator'),(6,'provokers','firebrand'),(7,'provokers','goad'),(8,'provokers','incendiary'),(9,'provokers','instigator'),(10,'provokers','operative'),(11,'bullying','Abuse'),(12,'bullying','Assaulted');

